import React, { useState } from 'react';
import FieldComponent from './FieldComponent';
import ViewDesignedFormButton from './ViewDesignedFormButton';
import DesignedForm from './DesignedForm';

const FormDesigner = () => {
  const [fields, setFields] = useState([]);
  const [newFieldType, setNewFieldType] = useState('text');
  const [newQuestion, setNewQuestion] = useState('');
  const [newOptions, setNewOptions] = useState('');
  const [newApplicableTo, setNewApplicableTo] = useState('student');

  const handleAddField = () => {
    const newField = {
      id: Math.random(),
      type: newFieldType,
      question: newQuestion,
      options: newOptions.split(',').map((option) => option.trim()),
      applicableTo: newApplicableTo,
    };
    setFields([...fields, newField]);
  };

  const handleDeleteField = (id) => {
    const updatedFields = fields.filter((field) => field.id !== id);
    setFields(updatedFields);
  };

  const handleApplyChanges = async () => {
    try {
      const response = await fetch('./api/form-fields', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(fields), // Send the fields data to the backend
      });
      const data = await response.json();
      console.log('Response from backend:', data);
      // Optionally, you can handle success or error responses here
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <div className="container-fluid mt-5">
      <div className="row">
        {/* Left side: Form Designer */}
        <div className="col-md-6">
          <div className="card shadow-sm">
            <div className="card-body">
              <h1 className="card-title text-center mb-4">Form Designer</h1>
              <div className="mb-3">
                <label htmlFor="fieldType" className="form-label">Field Type:</label>
                <select
                  id="fieldType"
                  value={newFieldType}
                  onChange={(e) => setNewFieldType(e.target.value)}
                  className="form-select"
                >
                  <option value="text">Text</option>
                  <option value="image">Image</option>
                  <option value="file">File Upload</option>
                </select>
              </div>
              <div className="mb-3">
                <label htmlFor="question" className="form-label">Question:</label>
                <input
                  type="text"
                  id="question"
                  value={newQuestion}
                  onChange={(e) => setNewQuestion(e.target.value)}
                  className="form-control"
                />
              </div>
              <div className="mb-3">
                <label htmlFor="applicableTo" className="form-label">Applicable To:</label>
                <select
                  id="applicableTo"
                  value={newApplicableTo}
                  onChange={(e) => setNewApplicableTo(e.target.value)}
                  className="form-select"
                >
                  <option value="student">Student</option>
                  <option value="employee">Employee</option>
                  <option value="both">Both</option>
                </select>
              </div>
              <div className="d-grid">
                <button
                  onClick={handleAddField}
                  className="btn btn-primary"
                >
                  Add Field
                </button>
              </div>
              <hr className="my-4" />
              {fields.map((field) => (
                <FieldComponent
                  key={field.id}
                  field={field}
                  onDelete={handleDeleteField}
                />
              ))}
              <div className="d-grid mt-4">
                <button
                  onClick={handleApplyChanges}
                  className="btn btn-success"
                >
                  Apply Changes
                </button>
              </div>
            </div>
          </div>
        </div>
        {/* Right side: View Page */}
        <div className="col-md-6">
          <div className="card shadow-sm">
            <div className="card-body">
              <DesignedForm fields={fields} />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FormDesigner;
